import { Navbar, NavbarBrand } from 'reactstrap';
import React from 'react';

const NaviBar = () => (
    <Navbar color="dark" dark expand="md"> 
        <NavbarBrand href="/">5/3/1</NavbarBrand>
    </Navbar>
)
  

export default NaviBar;
